export const getRandomItems = (count: number, initialArr: any[]) => {
  let itemsArr = [];

  for (let i = 0; i < count; i++) {
    const randomItem =
      initialArr[Math.floor(Math.random() * initialArr.length)];
    itemsArr.push(randomItem);
  }
  return itemsArr;
};
